import React from 'react';
import FeedPage from './pages/FeedPage';

function App() {
  return (
    <div className="app">
      <header className="app-header">
        <h1>iFunny Clone</h1>
      </header>
      <main>
        <FeedPage />
      </main>
    </div>
  );
}

export default App;
